import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form onC>
        <Router>
          <Routes>
            <Route path='/admin/adpage1' element={<Page1/>} />
          </Routes>
        </Router>
        <button className='Adbutton'>Admin</button>
        </form>

        <button className='Empbutton'>Employee</button>
      </header>
    </div>
  );
}

export default App;
